INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4977, 'listing', 312, 'ru', 'description', 'Пластиковые зубочистки в прозрачном контейнере-диспенсере. Упаковка содержит 150 штук. Изделия выполнены из качественного пластика, удобны в использовании. Контейнер имеет компактный размер и защитную крышку.', false, true, '2025-09-14 22:41:44.287706', '2025-09-14 22:41:44.287706', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4978, 'listing', 312, 'en', 'title', 'Plastic Toothpicks N1', true, false, '2025-09-14 22:41:44.288364', '2025-09-14 22:41:44.288364', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4979, 'listing', 312, 'en', 'description', 'Plastic toothpicks in a transparent dispenser container. Package contains 150 pieces. Made from quality plastic, convenient to use. The container has a compact size and protective lid.', true, false, '2025-09-14 22:41:44.28893', '2025-09-14 22:41:44.28893', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4980, 'listing', 312, 'sr', 'title', 'Plastične čačkalice N1', true, false, '2025-09-14 22:41:44.289614', '2025-09-14 22:41:44.289614', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4981, 'listing', 312, 'sr', 'description', 'Plastične čačkalice u providnoj kutiji-dozatoru. Pakovanje sadrži 150 komada. Izrađene su od kvalitetne plastike, pogodne za upotrebu. Kutija ima kompaktnu veličinu i zaštitni poklopac.', true, false, '2025-09-14 22:41:44.290228', '2025-09-14 22:41:44.290228', '{}', 1, NULL);
