INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4988, 'listing', 313, 'ru', 'title', 'Пылесос Миле Компакт С2', false, true, '2025-09-15 10:11:51.187281', '2025-09-15 10:11:51.187281', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4989, 'listing', 313, 'ru', 'description', 'Компактный пылесос Miele модели Compact C2 в белом корпусе. Оснащен мощной системой всасывания, телескопической трубкой, гибким шлангом и щеткой для пола. Пылесос в хорошем состоянии, имеет классический дизайн и удобную систему управления. Подходит для уборки различных типов напольных покрытий.', false, true, '2025-09-15 10:11:51.189377', '2025-09-15 10:11:51.189377', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4990, 'listing', 313, 'en', 'title', 'Miele Compact C2 Vacuum Cleaner', true, false, '2025-09-15 10:11:51.190091', '2025-09-15 10:11:51.190091', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4991, 'listing', 313, 'en', 'description', 'Compact Miele vacuum cleaner model Compact C2 in white housing. Equipped with a powerful suction system, telescopic tube, flexible hose, and floor brush. The vacuum cleaner is in good condition, has a classic design and convenient control system. Suitable for cleaning various types of floor coverings.', true, false, '2025-09-15 10:11:51.190622', '2025-09-15 10:11:51.190622', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4992, 'listing', 313, 'sr', 'title', 'Usisivač Miele Compact C2', true, false, '2025-09-15 10:11:51.191816', '2025-09-15 10:11:51.191816', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (4993, 'listing', 313, 'sr', 'description', 'Kompaktni usisivač Miele model Compact C2 u belom kućištu. Opremljen snažnim sistemom usisavanja, teleskopskom cevi, fleksibilnim crevom i četkom za pod. Usisivač je u dobrom stanju, ima klasičan dizajn i praktičan sistem kontrole. Pogodan za čišćenje različitih vrsta podnih obloga.', true, false, '2025-09-15 10:11:51.192354', '2025-09-15 10:11:51.192354', '{}', 1, NULL);
