INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5067, 'listing', 318, 'en', 'description', 'Set of three healthy thuja (arborvitae) shrubs in black plastic nursery pots. Bright green foliage, well-maintained and ready for planting. Each plant is approximately 2-3 feet tall, perfect for hedging or accent planting. Located in a garden center or nursery setting.', false, true, '2025-09-22 13:06:47.60402', '2025-09-22 13:06:47.60402', '{}', 1, NULL);
