INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5069, 'listing', 318, 'ru', 'description', 'Набор из трех здоровых туй в черных пластиковых питомниковых горшках. Ярко-зеленая листва, хорошо ухоженные и готовые к посадке. Каждое растение высотой примерно 60-90 см, идеально подходит для живой изгороди или акцентного озеленения. Находится в садовом центре или питомнике.', true, false, '2025-09-22 13:06:47.60529', '2025-09-22 13:06:47.60529', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5070, 'listing', 318, 'sr', 'title', 'Tuje u saksijama - zimzeleno žbunje', true, false, '2025-09-22 13:06:47.605844', '2025-09-22 13:06:47.605844', '{}', 1, NULL);
