INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5092, 'listing', 320, 'sr', 'title', 'Siva sofa sa dekorativnim jastucima', true, false, '2025-09-22 17:31:07.59913', '2025-09-22 17:31:07.59913', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5093, 'listing', 320, 'sr', 'description', 'Udobna siva sofa u dobrom stanju. Dolazi sa dekorativnim jastucima u zelenoj i roze boji. Presvlaka od velura, meko sedište sa efektom prošivanja. Na zidu iznad sofe su postavljene slike. Savršeno će se uklopiti u moderan enterijer.', true, false, '2025-09-22 17:31:07.599653', '2025-09-22 17:31:07.599653', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5094, 'listing', 320, 'en', 'title', 'Gray sofa with decorative pillows', true, false, '2025-09-22 17:31:07.60015', '2025-09-22 17:31:07.60015', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5095, 'listing', 320, 'en', 'description', 'Comfortable gray sofa in good condition. Comes with decorative pillows in green and pink colors. Velour upholstery, soft seat with tufted effect. Pictures are placed on the wall above the sofa. Will fit perfectly into modern interior.', true, false, '2025-09-22 17:31:07.600637', '2025-09-22 17:31:07.600637', '{}', 1, NULL);
