INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5103, 'listing', 321, 'ru', 'description', 'Двухместный кожаный диван в синем цвете. Имеет потертости на подлокотниках. Мягкие сидения с секциями, комфортная спинка. Диван находится в использованном состоянии, но сохраняет функциональность. Обивка из натуральной кожи, прочная конструкция.', false, true, '2025-09-22 17:38:34.85089', '2025-09-22 17:38:34.85089', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5104, 'listing', 321, 'en', 'title', 'Blue leather sofa', true, false, '2025-09-22 17:38:34.851417', '2025-09-22 17:38:34.851417', '{}', 1, NULL);
