INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5129, 'listing', 323, 'en', 'description', 'Canon PIXMA G3420 inkjet multifunction printer in excellent condition. The printer is equipped with a Continuous Ink Supply System (CISS), has printing, scanning, and copying functions. Supports wireless connection via Wi-Fi. LCD display for convenient control. Economical printing thanks to refillable ink tanks.', true, false, '2025-09-23 10:05:21.088341', '2025-09-23 10:05:21.088341', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5130, 'listing', 323, 'sr', 'title', 'Canon PIXMA G3420 MFU', true, false, '2025-09-23 10:05:21.089077', '2025-09-23 10:05:21.089077', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5131, 'listing', 323, 'sr', 'description', 'Canon PIXMA G3420 inkjet multifunkcionalni uređaj u odličnom stanju. Štampač je opremljen sistemom za kontinualno snabdevanje mastilom (CISS), ima funkcije štampanja, skeniranja i kopiranja. Podržava bežično povezivanje preko Wi-Fi-ja. LCD ekran za jednostavno upravljanje. Ekonomično štampanje zahvaljujući dopunjivim rezervoarima za mastilo.', true, false, '2025-09-23 10:05:21.089747', '2025-09-23 10:05:21.089747', '{}', 1, NULL);
