INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5142, 'listing', 324, 'sr', 'description', 'Profesionalni skalpel za precizno sečenje papira i kartona. Metalno kućište sa gumiranom drškom za sigurno držanje. Poseduje mehanizam za zaključavanje sečiva i sistem za zamenu oštrice. Sečivo je izuzetno oštro i pogodno za precizne rezove.', false, true, '2025-09-23 10:20:17.076061', '2025-09-23 10:20:17.076061', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5143, 'listing', 324, 'en', 'title', 'Paper Cutting Knife', true, false, '2025-09-23 10:20:17.076655', '2025-09-23 10:20:17.076655', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5144, 'listing', 324, 'en', 'description', 'Professional cutting knife for precise cutting of paper and cardboard. Metal housing with rubber grip for secure holding. Features blade locking mechanism and blade replacement system. The blade is extremely sharp and suitable for precise cuts.', true, false, '2025-09-23 10:20:17.077122', '2025-09-23 10:20:17.077122', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5145, 'listing', 324, 'ru', 'title', 'Нож для бумаги', true, false, '2025-09-23 10:20:17.077596', '2025-09-23 10:20:17.077596', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5146, 'listing', 324, 'ru', 'description', 'Профессиональный нож для точной резки бумаги и картона. Металлический корпус с прорезиненной ручкой для надежного захвата. Имеет механизм блокировки лезвия и систему замены лезвия. Лезвие очень острое и подходит для точных разрезов.', true, false, '2025-09-23 10:20:17.078072', '2025-09-23 10:20:17.078072', '{}', 1, NULL);
