INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5159, 'listing', 325, 'en', 'title', 'Upholstered Dining Room Chair', false, true, '2025-09-23 12:35:15.735117', '2025-09-23 12:35:15.735117', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5160, 'listing', 325, 'en', 'description', 'Modern dining chair featuring light grey upholstery and wooden legs. The chair appears to be in excellent condition with clean lines and contemporary design. Comfortable padding and durable fabric make it suitable for daily use. The chair has a high back design for added comfort.', false, true, '2025-09-23 12:35:15.73602', '2025-09-23 12:35:15.73602', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5161, 'listing', 325, 'ru', 'title', 'Современный Обеденный Стул', true, false, '2025-09-23 12:35:15.736796', '2025-09-23 12:35:15.736796', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5196, 'listing', 328, 'en', 'description', 'SEAT Arona compact SUV in burgundy red color with black roof. The vehicle appears to be in excellent condition with alloy wheels, LED headlights, and roof rails. Features a modern design with plastic body cladding typical of crossover SUVs.', false, true, '2025-09-25 16:25:24.345801', '2025-09-25 16:25:24.345801', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5197, 'listing', 328, 'sr', 'title', 'SEAT Arona SUV', true, false, '2025-09-25 16:25:24.346754', '2025-09-25 16:25:24.346754', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5198, 'listing', 328, 'sr', 'description', 'SEAT Arona kompaktni SUV u bordo crvenoj boji sa crnim krovom. Vozilo je u odličnom stanju sa aluminijumskim felnama, LED farovima i krovnim nosačima. Odlikuje ga moderan dizajn sa plastičnom zaštitom karoserije tipičnom za crossover SUV vozila.', true, false, '2025-09-25 16:25:24.347359', '2025-09-25 16:25:24.347359', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5199, 'listing', 328, 'ru', 'title', 'SEAT Arona SUV', true, false, '2025-09-25 16:25:24.347933', '2025-09-25 16:25:24.347933', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5200, 'listing', 328, 'ru', 'description', 'SEAT Arona компактный SUV бордового цвета с черной крышей. Автомобиль находится в отличном состоянии, оснащен легкосплавными дисками, светодиодными фарами и рейлингами на крыше. Отличается современным дизайном с пластиковой защитой кузова, типичной для кроссоверов.', true, false, '2025-09-25 16:25:24.348472', '2025-09-25 16:25:24.348472', '{}', 1, NULL);
