INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5162, 'listing', 325, 'ru', 'description', 'Современный обеденный стул со светло-серой обивкой и деревянными ножками. Стул находится в отличном состоянии, отличается четкими линиями и современным дизайном. Удобная набивка и прочная ткань делают его подходящим для ежедневного использования. Стул имеет высокую спинку для дополнительного комфорта.', true, false, '2025-09-23 12:35:15.737403', '2025-09-23 12:35:15.737403', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5163, 'listing', 325, 'sr', 'title', 'Moderna Trpezarijska Stolica', true, false, '2025-09-23 12:35:15.738085', '2025-09-23 12:35:15.738085', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5164, 'listing', 325, 'sr', 'description', 'Moderna trpezarijska stolica sa svetlo sivim tapacirungom i drvenim nogama. Stolica je u odličnom stanju sa čistim linijama i savremenim dizajnom. Udobno punjenje i izdržljiva tkanina čine je pogodnom za svakodnevnu upotrebu. Stolica ima dizajn sa visokim naslonom za dodatnu udobnost.', true, false, '2025-09-23 12:35:15.739042', '2025-09-23 12:35:15.739042', '{}', 1, NULL);
