INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5172, 'listing', 326, 'en', 'description', 'Modern dining chair with light gray upholstery and wooden legs. Features a high backrest and comfortable padded seat. The chair appears to be in excellent condition with clean, contemporary styling. Perfect for dining room or kitchen use.', false, true, '2025-09-23 13:07:51.380147', '2025-09-23 13:07:51.380147', '{}', 1, NULL);
