INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5184, 'listing', 327, 'en', 'description', 'Modern upholstered dining chair in beige fabric with wooden legs. Features a high backrest and comfortable padded seat. The chair appears to be in excellent condition with clean upholstery and sturdy construction. Neutral color scheme that would complement most dining room decors.', false, true, '2025-09-23 13:38:23.671353', '2025-09-23 13:38:23.671353', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5185, 'listing', 327, 'ru', 'title', 'Мягкий Обеденный Стул', true, false, '2025-09-23 13:38:23.672056', '2025-09-23 13:38:23.672056', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5186, 'listing', 327, 'ru', 'description', 'Современный мягкий обеденный стул в бежевой ткани с деревянными ножками. Имеет высокую спинку и удобное мягкое сиденье. Стул находится в отличном состоянии с чистой обивкой и прочной конструкцией. Нейтральная цветовая гамма, которая дополнит большинство интерьеров столовой.', true, false, '2025-09-23 13:38:23.672605', '2025-09-23 13:38:23.672605', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5187, 'listing', 327, 'sr', 'title', 'Tapacirana Trpezarijska Stolica', true, false, '2025-09-23 13:38:23.673119', '2025-09-23 13:38:23.673119', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5188, 'listing', 327, 'sr', 'description', 'Moderna tapacirana trpezarijska stolica u bež tkanini sa drvenim nogama. Odlikuje se visokim naslonom i udobnim tapaciranim sedištem. Stolica je u odličnom stanju sa čistom tapacirungom i čvrstom konstrukcijom. Neutralna kombinacija boja koja bi se uklopila u većinu trpezarijskih enterijera.', true, false, '2025-09-23 13:38:23.673693', '2025-09-23 13:38:23.673693', '{}', 1, NULL);
