INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5208, 'listing', 329, 'ru', 'description', 'Компактный кроссовер SEAT Arona в отличном состоянии. Автомобиль в красно-бордовом цвете с черной крышей, оснащен современными светодиодными фарами, легкосплавными дисками, имеет стильный дизайн и высокий клиренс. Городской кроссовер идеально подходит для повседневного использования.', false, true, '2025-09-25 17:19:32.085785', '2025-09-25 17:19:32.085785', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5209, 'listing', 329, 'sr', 'title', 'SEAT Arona 2020', true, false, '2025-09-25 17:19:32.086401', '2025-09-25 17:19:32.086401', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5210, 'listing', 329, 'sr', 'description', 'SEAT Arona kompaktni krosover u odličnom stanju. Automobil je crveno-bordo boje sa crnim krovom, opremljen modernim LED farovima, aluminijumskim felnama, ima stilski dizajn i visok klirens. Gradski krosover idealan za svakodnevnu upotrebu.', true, false, '2025-09-25 17:19:32.086912', '2025-09-25 17:19:32.086912', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5211, 'listing', 329, 'en', 'title', 'SEAT Arona 2020', true, false, '2025-09-25 17:19:32.087421', '2025-09-25 17:19:32.087421', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5212, 'listing', 329, 'en', 'description', 'SEAT Arona compact crossover in excellent condition. The car comes in red-burgundy color with a black roof, equipped with modern LED headlights, alloy wheels, features a stylish design and high ground clearance. This urban crossover is perfect for everyday use.', true, false, '2025-09-25 17:19:32.087955', '2025-09-25 17:19:32.087955', '{}', 1, NULL);
