INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5219, 'listing', 330, 'ru', 'title', 'Мазда 3', false, true, '2025-09-26 16:06:05.31362', '2025-09-26 16:06:05.31362', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5220, 'listing', 330, 'ru', 'description', 'Современный седан Mazda 3 в отличном состоянии. Автомобиль имеет стильный серый металлик цвет кузова, элегантный дизайн с характерными для бренда плавными линиями. Оснащен легкосплавными дисками, имеет аэродинамичный профиль и характерную решетку радиатора. Видны хромированные элементы отделки и тонированные стекла.', false, true, '2025-09-26 16:06:05.314726', '2025-09-26 16:06:05.314726', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5221, 'listing', 330, 'en', 'title', 'Mazda 3 Sedan', true, false, '2025-09-26 16:06:05.315525', '2025-09-26 16:06:05.315525', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5222, 'listing', 330, 'en', 'description', 'Modern Mazda 3 sedan in excellent condition. The car has a stylish gray metallic body color, elegant design with brand-characteristic smooth lines. Equipped with alloy wheels, it has an aerodynamic profile and distinctive radiator grille. Chrome trim elements and tinted windows are visible.', true, false, '2025-09-26 16:06:05.316103', '2025-09-26 16:06:05.316103', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5223, 'listing', 330, 'sr', 'title', 'Mazda 3 Sedan', true, false, '2025-09-26 16:06:05.316658', '2025-09-26 16:06:05.316658', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5224, 'listing', 330, 'sr', 'description', 'Moderan Mazda 3 sedan u odličnom stanju. Automobil ima stilsku sivu metalik boju karoserije, elegantan dizajn sa karakterističnim glatkim linijama brenda. Opremljen je aluminijumskim felnama, ima aerodinamični profil i karakterističnu masku hladnjaka. Vidljivi su hromirani elementi i zatamnjena stakla.', true, false, '2025-09-26 16:06:05.317215', '2025-09-26 16:06:05.317215', '{}', 1, NULL);
