INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5231, 'listing', 331, 'en', 'title', 'Toyota Yaris', false, true, '2025-09-26 16:54:59.29343', '2025-09-26 16:54:59.29343', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5232, 'listing', 331, 'en', 'description', 'Silver Toyota Yaris hatchback in used condition. 5-door compact car with steel wheels and hubcaps. The vehicle appears to be from around 2008-2010 generation, showing some signs of use but overall in decent condition. Parked on a residential street with decorative fence in background.', false, true, '2025-09-26 16:54:59.294114', '2025-09-26 16:54:59.294114', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5233, 'listing', 331, 'ru', 'title', 'Тойота Ярис Хэтчбек', true, false, '2025-09-26 16:54:59.29479', '2025-09-26 16:54:59.29479', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5234, 'listing', 331, 'ru', 'description', 'Серебристый хэтчбек Toyota Yaris в подержанном состоянии. 5-дверный компактный автомобиль со стальными дисками и колпаками. Автомобиль, предположительно, 2008-2010 года выпуска, имеет признаки использования, но в целом находится в хорошем состоянии. Припаркован на жилой улице с декоративным забором на заднем плане.', true, false, '2025-09-26 16:54:59.295288', '2025-09-26 16:54:59.295288', '{}', 1, NULL);
INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5235, 'listing', 331, 'sr', 'title', 'Toyota Jaris Hečbek', true, false, '2025-09-26 16:54:59.295817', '2025-09-26 16:54:59.295817', '{}', 1, NULL);
