INSERT INTO public.translations (id, entity_type, entity_id, language, field_name, translated_text, is_machine_translated, is_verified, created_at, updated_at, metadata, version, last_modified_by) VALUES (5244, 'listing', 332, 'en', 'description', 'Silver Ford S-Max in used condition. Features custom dark alloy wheels, tinted windows, and appears to be well-maintained. The vehicle has a sporty appearance with its distinctive MPV body style. Parked in an urban residential area.', false, true, '2025-09-26 17:35:38.940443', '2025-09-26 17:35:38.940443', '{}', 1, NULL);
